import React from "react";

export default function Card({ cards, onCardClick }) {
  return (
    <section className="elements">
            <div className="element">
              {cards.map((card)=> (
             <div key={card.id} className="card">
              <img onClick={() => onCardClick(card)} src={card.link} alt={card.name} className="element__image" />
                <div className="element__item">
                 <h2 className="element__name">{card.name}</h2>
                <div className="element__like_about">
                  <button className="element__like" type="button"></button>
                  <button className="element__delete-btn"></button>
                  <span className="element__like_counter">{card.likes.length}</span>
                </div>
                </div>
             </div>
              ))};
              console.log(card)
            </div>
        </section>
  );
}
